import React from "react";
import BookingModal from "./BookingModal";

export default class AdminContentComponent extends React.Component {

  state = {
    user: this.props.user
  };

  componentDidUpdate(prevProps, prevState, snapshot) {
    if (prevProps.user._id !== this.props.user._id) {
      this.setState({
        user: this.props.user
      })
    }
  }

  render() {

    // console.log("admin content", this.state.user)
    return (
        <tr>
          <th scope="row">{this.state.user.first}</th>
          <td>{this.state.user.last}</td>
          <td>{this.state.user.email}</td>
          <td>{this.state.user.password}</td>
          <td>
            <button type="button"
                    className="btn btn-primary"
                    data-toggle="modal"
                    data-target="#bookingModal">
              Show bookings
            </button>
            <BookingModal
              tickets={this.state.user.ticketsBooked}
            />
          </td>

        </tr>
    )
  }
}
